    public String shortestPalindrome(String s) {
        long start = System.currentTimeMillis();
        String ret = s;
        if(null != s && s.length() >1) {
            int len = longestPalindrome(s);
            System.out.println(len);
            if(len < s.length()){
                System.out.println("hello");
                String postFix = s.substring(len, s.length());
                ret = reverse(postFix) + s;
            }
        }
        System.out.println(System.currentTimeMillis() - start);
        return ret;
    }

    public boolean isPalindrome(int start, int end, String str) {
        int l = start;
        int r = end;
        boolean ret = true;
        char [] chars = str.toCharArray();
        while(l < r) {
            if(chars[l++] != chars[r--]){
                ret = false;
                break;
            }
        }
        return ret;
    }

    public int longestPalindrome(String str) {
        int ret = 0;
        for (int end = str.length()-1; end >= 0; --end){
            if(isPalindrome(0, end, str)) {
                ret = end+1;
                break;
            }
        }
        return ret;
    }

    public String reverse (String s) {
        StringBuilder sb = new StringBuilder(s);
        return sb.reverse().toString();
    }
